import React from 'react';
import { Table,Button } from 'semantic-ui-react';
import Axios from 'axios';

class Home extends React.Component{

    state={
        fullData:[],
        page:[]
    }

    componentDidMount(){
        Axios.get('https://todo-34b9f.firebaseio.com/page.json')
        .then(response => {
            console.log(response);
            const fetchedOrders=[];
                     for(let key in response.data) {
                         fetchedOrders.push({
                             ...response.data[key],
                             id:key
                         });
                     }
                     console.log("fetched Api",fetchedOrders)
                     this.setState({fullData:fetchedOrders})
        }).catch(error =>{
            console.log(error);
        })
    }


    render(){
        let page;

        page=
        <table class="table table-sm table-dark">
            <Table.Header>
            <tr class="table-primary"></tr>
            </Table.Header>

            {this.state.fullData.map(perPage => (
                <Table.Row>
                    <Table.Cell>{perPage.title}</Table.Cell>
                    <Button>Read</Button>
                    <Button>Edit</Button>
                </Table.Row>
            ))}
          </table>



        return(
            <>
            <h1> Pages </h1>
            <Button>Add</Button>
            {page}
            </>
        )
    }
}

export default Home;
